Authentication.controller("AuthenticationController",["$scope","$location","$window","UserService","AuthenticationService",function(n,e,o,t,c){n.signIn=function(n,s){null!=n&&null!=s&&t.login(n,s).success(function(n){c.isAuthenticated=!0,o.sessionStorage.access_token=n.access_token,o.sessionStorage.refresh_token=n.refresh_token,e.path("/canvas")}).error(function(n,e){console.log(n),console.log(e)})}}]);